      profilePicUrl: "https://image.shutterstock.com/image-photo/closeup-face-headshot-pug-dog-260nw-250466800.jpg"
    };
    return (
      <>
        {/* <Router>
          <Switch>
            { ROUTES.map((route, index) => <Route key={index} { ...route } />) }
          </Switch>
        </Router> */}
        <ProfileCard user={user} cardColor={"#9EC0FE"} />
        <DrugCard allDrugs/>
      </>
    );
  }
}

export default App;
